import React from "react";
import Header from "../components/Header";

export default function About() {
  return (
    <>
      <Header />
      <main className=" border-4 border-red-400">
        <section className="min-h-screen bg-gray-400 pt-10">
          <h2 className="relative top-40 text-center">About</h2>
        </section>
      </main>
    </>
  );
}
